import React from 'react'

class Background extends React.Component{
    render(){
        return(
            <div className='background carousel slide carousel-fade'>
                <div className = 'carousel-inner'>
                    <div className='carousel-item active'>
                        <img src='https://img.hobbyfarms.com/breeds_aberdeen.jpg' alt='' className='d-block w-100 ' style="height:70%"/>
                    </div>
                    <div className='carousel-item'>
                        <img src="https://i0.wp.com/steaksociety.com/wp-content/uploads/2017/08/angus.jpg?w=768&ssl=1" alt='' className='d-block w-100'/>
                    </div>
                    <div className='carousel-item'>
                        <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSTtENYf-bFwdPHYtdFsM44Tju3hOXor72Klw&usqp=CAU' alt='' className='d-block w-100'/>
                    </div>
                </div>

            </div>
        );
    }
}

export default Background
